import ViajeContext from "context/ViajesContext";
import React, { useContext } from "react";

const ViajesCrud = () => {
  const { viajes } = useContext(ViajeContext);

  return (
    <>
      {viajes.map((viaje) => {
        <div>
          <p>{viaje.omnibus}</p>
          <p>{viaje.chofer1}</p>
          <p>{viaje.chofer2}</p>
          <p>{viaje.hora}</p>
        </div>;
      })}
    </>
  );
};

export default ViajesCrud;
